import React from "react";
import Recipes from "../data/TestRecipes.json"


function RecipeDisplay() {

    return (
        <div>
            <h1>Recipes</h1>
            {Recipes.map((recipe) => (
            <div key={recipe.id}>
                <RecipeCard>
                    recipe = { recipe }
                </RecipeCard>
            </div>
            ))}
        </div>
    );
};


export default RecipeDisplay;
